import React from "react";
import photo from "./images/photo.png"

function About() {
  return (
    <>
    <div className="row">
        <div className="col-lg-6">
            <img src={photo} alt="" />
        </div>
    </div>
      <h1 className="about">About</h1>
      <h6>
        With over 2.5 years of experience working in Tata Consultancy Services,
        I am a skilled front-end developer proficient in HTML, CSS, ReactJS,
        JavaScript, React Native, and Redux. I have a strong understanding of
        version control systems like GitHub and project management tools like
        JIRA. My expertise lies in creating responsive and interactive user
        interfaces that enhance the overall user experience.
      </h6>
    </>
  );
}

export default About;
